"use strict";require("../utils/request.js"),exports.uploadImages=async function(o){const t=new FormData;for(const r of o){const o=await fetch(r),e=await o.blob(),s=`image-${Date.now()}.jpg`;t.append("files",e,s)}try{const o=await fetch("https://share.cs.kvxin.top/uploads",{method:"POST",body:t});if(!o.ok)throw new Error("Network response was not ok.");return await o.json()}catch(e){console.error("Error:",e)}};
